import React from 'react';
import Button from 'react-bootstrap/Button';
import '../css/Landing.css';
import { useAuth0 } from '@auth0/auth0-react';

const LogoutButton = () => {
    const { logout } = useAuth0();

    return (
        <Button
            size="lg"
            onClick={() => logout()}>
            Log out
        </Button>
    )
}

export default LogoutButton;
